import React from 'react';

class ProductItem extends React.Component {
	constructor(props){
		super(props);
	}
	render(){
		return (
			<div className="arrivals-item">
				<h3>{this.props.name}</h3>
			</div>
		)
	}
}

export default ProductItem;
